import React from "react";
import "./App.css";
import logo from './Images/Logo/logo.png';
import MainBackground from './Images/MainBackground/MainBackground.jpg'
import Header from "./components/Header/Header";
import Navbar from "./components/Navbar/Navbar";
import Profile from "./components/Profile/Profile";
import Dialogs from "./components/Dialogs/Dialogs";
import {BrowserRouter, Route} from "react-router-dom";
import News from "./components/News/News";
import Music from "./components/Music/Music";
import Settings from "./components/Settings/Settings";

type DialogsStructureType ={
    id: number
    name: string
}
type MessagesStructureType = {
    id: number
    message: string
}
type ProfileStructureType = {
    id: number
    message: string
    likesCount: number
}

type AppPropsType = {
    dialogs: Array<DialogsStructureType>
    messages: Array<MessagesStructureType>
    posts: ProfileStructureType[]
}
const App = (props:AppPropsType ) => {



    return (
        <BrowserRouter>
        <div className='app-wrapper'>
            <Header/>
            <Navbar/>
            <div className='app-wrapper-content'>
                <Route path={'/dialogs'} render={()=> <Dialogs dialogs={props.dialogs} messages={props.messages}/>}/>
                <Route path={'/profile'} render={()=> <Profile posts={props.posts}/>}/>
                <Route path={'/news'} render={()=> <News/>}/>
                <Route path={'/music'} render={()=> <Music/>}/>
                <Route path={'/settings'} render={()=> <Settings/>}/>


                {/*<Route path={'/dialogs'} component={Dialogs}/>*/}
                {/*<Route path={'/profile'} component={Profile}/>*/}
                {/*<Route path={'/news'} component={News}/>*/}
                {/*<Route path={'/music'} component={Music}/>*/}
                {/*<Route path={'/settings'} component={Settings}/>*/}
            </div>
        </div>
        </BrowserRouter>
    );
}


export default App;
